package heap;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;

public class FindAnagrams {
    public List<Integer> findAnagrams(String s, String p) {

        List<Integer> result = new ArrayList<>();

        //1. find the size of p
        // 2. iterate String s and make substrings of p size and compare
        // terminate the loop total length - index < p

        int i=0;
        while( s.length()-i >= p.length()){
            if(isEqual(s.substring(i,i+p.length()),p)){
                result.add(i);
            }
            i++;
        }
        return result;
    }

    public static boolean isEqual(String a, String b) {
        System.out.println("a:"+a+",b:"+b);
        char[] aArray = a.toCharArray();
        char[] bArray = b.toCharArray();
        Arrays.sort(aArray);
        Arrays.sort(bArray);

        for(int i=0;i<aArray.length;i++){
            if(aArray[i]!=bArray[i]){
                return false;
            }
        }
        return true;
    }

    public static void main(String[] args) {
        FindAnagrams f = new FindAnagrams();

        String s="\"\"\n";
        String p="\"\"";
        System.out.println(f.findAnagrams("cbaebabacd", "abc"));
        System.out.println(f.findAnagrams("cba", "abc"));
        System.out.println(f.findAnagrams("ba", "aa"));
        System.out.println(f.findAnagrams(s,p));
//        System.out.println(f.findAnagrams("ab", "d"));
//        System.out.println(f.findAnagrams("ab", "a"));
//        System.out.println(f.findAnagrams("ab", "a"));
//        System.out.println(f.findAnagrams("ab", "a"));
//        System.out.println(f.findAnagrams("ab", "a"));
//        System.out.println(f.findAnagrams("ab", "a"));

    }
}
